import React from "react";
import '../assets/css/SearchTop.css';
import {InputItem } from 'antd-mobile';
import onecallfun from "../Utils/OneCallFun";
class SearchTop extends React.Component {
  // componentDidMount() {
  //   document.title = '开发中';
  //  }
  searchFun(){
  this.props.history.push("/search");
  }
  render() {

    return (
      <div className="searchbox">
        <InputItem placeholder="输入你想要凑单商品的淘口令/链接/昵称"/>
        <div className="searchBtn" onClick={()=>onecallfun(()=>{this.searchFun();})}><span>搜索</span></div>
      </div>
    );
  }
}

export default SearchTop;
